import React from "react";

const Header = () => {
    return(
        <div className="text-center">
            <div>
                <h1 className='logo'>Recipes</h1>
                <ul className='nav'>
                </ul>
            </div>
            <div className='presentation'></div>
        </div>
    )
}

export default Header;
